import React, { useState } from "react";
import axios from "axios";

const TripChecklistForm = () => {
  const [formData, setFormData] = useState({
    loadWeight: "",
    loadType: "",
    source: "",
    destination: "",
    vehicleNumber: "",
    notes: "",
  });
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem("token");
      await axios.post("http://localhost:5000/api/trip-checklist", formData, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setSuccess("Trip checklist submitted successfully!");
      setFormData({
        loadWeight: "",
        loadType: "",
        source: "",
        destination: "",
        vehicleNumber: "",
        notes: "",
      });
      setError("");
    } catch (err) {
      setError(err.response?.data?.message || "Failed to submit checklist");
      setSuccess("");
    }
  };

  return (
    <div className="bg-white p-6 rounded-xl shadow-md">
      <h3 className="text-2xl font-semibold mb-4 text-gray-800">
        Trip Checklist
      </h3>
      {error && <p className="text-red-500 mb-4">{error}</p>}
      {success && <p className="text-green-500 mb-4">{success}</p>}
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label className="block text-gray-700">Load Weight (tonnes)</label>
          <input
            type="number"
            name="loadWeight"
            value={formData.loadWeight}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
            min="0"
            step="0.1"
          />
        </div>
        <div>
          <label className="block text-gray-700">Load Type</label>
          <input
            type="text"
            name="loadType"
            value={formData.loadType}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>
        <div>
          <label className="block text-gray-700">Source</label>
          <input
            type="text"
            name="source"
            value={formData.source}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>
        <div>
          <label className="block text-gray-700">Destination</label>
          <input
            type="text"
            name="destination"
            value={formData.destination}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>
        <div>
          <label className="block text-gray-700">Vehicle Number</label>
          <input
            type="text"
            name="vehicleNumber"
            value={formData.vehicleNumber}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>
        <div>
          <label className="block text-gray-700">Notes</label>
          <textarea
            name="notes"
            value={formData.notes}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            rows="4"
          />
        </div>
        <button
          type="submit"
          className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
        >
          Submit Checklist
        </button>
      </form>
    </div>
  );
};

export default TripChecklistForm;
